import React from "react";
import "../assets/custom.css";

const GetStarted = () => {
  return (
    <>
      <main className="md:pl-12 get-started-bg">
        <div className="flex-row justify-center">
          <div className="w-2/4 md:w-1/3 m-auto">
            <img src="/img/agile-credit-logo-large.svg" alt="" className="" />
            <p>Quick money. Anytime!</p>
          </div>
          <button className="border-blue-700 border-2">Get Started</button>
        </div>
      </main>
    </>
  );
};
export default GetStarted;
